import './App.css';

function App() {
  return (
  <div className="container">
    <h1>Sistema De Archivos EXT2</h1>

    <div class="buttons">
      <button id="selectBtn">Seleccionar</button>
      <button id="executeBtn">Ejecutar</button>
    </div>

    <div class="input-section">
      <h2>Entrada:</h2>
      <textarea id="inputArea"></textarea>
    </div>

    <div class="output-section">
      <h2>Salida:</h2>
        <textarea id="outputArea" placeholder="Salida"/>
    </div>

    </div>

  );
}

export default App;
